let viewportHeight=window.innerHeight;function getViewportHeight(){document.querySelector(":root").style.setProperty("--vh",viewportHeight/100+"px")}window.addEventListener("resize",getViewportHeight),getViewportHeight(),"serviceWorker"in navigator&&window.addEventListener("load",function(){navigator.serviceWorker.register("/serviceWorker.js").then(e=>console.log("service worker registered")).catch(e=>console.log("service worker not registered",e))});